import './Expenses.css';
import { ExpenseItem } from './ExpenseItem';


export function Expenses(props){

    return (
        <Card className="expenses">
        <ExpenseItem expense={props.expenses[0]}/>
        <ExpenseItem expense={props.expenses[1]}/>
        <ExpenseItem expense={props.expenses[2]}/>

        </Card>
    )


}
